import "./styles.css";

export default function Navbar() {
  return (
    <div className="navbar">
    <nav id="navbar">
        <a href="https://www.linkedin.com/in/d-f-l-linton/" target="_blank"><p>LinkedIn</p></a>
        <a href="https://github.com/DFLLinton" target="_blank"><p>Github </p></a>
    </nav>
    </div>
  );
}
